import React, {Component} from 'react';

class Footer extends Component {
  render(){
    return(
        <footer>
          <Row className="top align-items-center">
          <Container>
            <Col>
              <p className="label-dark">Top Nav.</p>
            </Col>
          </Container>
        </Row>
        </footer>
    )
}
}


export default Footer;
